import React from 'react';
import './CreateTodoButton.css';

function CreateTodoButton(props){
	return(
		<React.Fragment>
		<div className="CreateTodoButton"></div>
		<button className="CreateTodoButton">+</button>
		</React.Fragment>
	);
}

export { CreateTodoButton };
